    if (rc != QUVI_OK)

        return AVERROR(ENOMEM);

    score = quvi_supported(q, (char *)p->filename) == QUVI_OK ? AVPROBE_SCORE_EXTENSION : 0;

    quvi_close(&q);

    return score;

}

